        void right_shift_triangle_colors(short int *arr){
            short int t0=arr[0];
            short int t1=arr[1];
            short int t2=arr[2];
            short int t3=arr[3];
            
            arr[0]=t3;
            arr[1]=t0;
            arr[2]=t1;
            arr[3]=t2;
        }

        void left_shift_triangle_colors(short int *arr){
            short int t0=arr[0];
            short int t1=arr[1];
            short int t2=arr[2];
            short int t3=arr[3];
            
            arr[0]=t1;
            arr[1]=t2;
            arr[2]=t3;
            arr[3]=t0;
        }

        //BRESENHAM'S CIRCLE DRAWING ALGORITHM

        void circleBres(int xc, int yc, int r,short int color){ 
            int x = 0, y = r; 
            int d = 3 - 2 * r; 
            drawCircle(xc, yc, x, y,color); 
            while (y >= x){ 
                x++;
                if (d > 0){ 
                    y--;  
                    d = d + 4 * (x - y) + 10; 
                } 
                else
                    d = d + 4 * x + 6; 

                drawCircle(xc, yc, x, y, color);   
            } 
        }

        void drawCircle(int xc, int yc, int x, int y,short int color){ 
            write_pixel(xc+x, yc+y, color); 
            write_pixel(xc-x, yc+y, color); 
            write_pixel(xc+x, yc-y, color); 
            write_pixel(xc-x, yc-y, color); 
            write_pixel(xc+y, yc+x, color); 
            write_pixel(xc-y, yc+x, color); 
            write_pixel(xc+y, yc-x, color); 
            write_pixel(xc-y, yc-x, color); 
        }

        void draw_filledCircle(int xc, int yc, int r, int short color){
            for(int i=0;i<=r;i++){
                circleBres(xc, yc, i, color);
            }
        }

        void erase_filledCircle(int xc, int yc, int r){
            for(int i=0;i<=r;i++){
                circleBres(xc, yc, i, 0x973F);        //Our Background
            }
        }

        void swap(int *x,int *y){
            int temp=*x;
            *x=*y;
            *y=temp;
        }


        void clear_screen() {
        int x, y;
        char* c = "";
        for (x = 0; x < 320; x++) {
            for (y = 0; y < 240; y++) {
            write_pixel(x,y,0x973F);        //Our Background

            }
        }

        for(x=0; x<80; x++){
            for(y=0; y<60; y++){
                write_char(x,y,*c);
            }
        }
        }

        void write_pixel(int x, int y, short int color) {
        volatile short *vga_addr=(volatile short*)(0x08000000 + (y<<10) + (x<<1));
        *vga_addr=color;
        }

        void write_char(int x, int y, char c) {
        // VGA character buffer
        volatile char * character_buffer = (char *) (0x09000000 + (y<<7) + x);
        *character_buffer = c;
        }



